import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Game from './game';
import Images from './images';

class App extends Component {
  state = {
    image: [
        {
            id: 1,
            image: "data:image/jpeg;base64,",
            clicked: false
        },
        {
            id: 2,
            image: "data:image/jpeg;base64,",
            clicked: false
        },
        {
            id: 3,
            image: "data:image/jpeg;base64,",
            clicked: false
        },
        {
            id: 4,
            image: "data:image/jpeg;base64,",
            clicked: false
        },
        {
            id: 5,
            image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRiYRW0_Or8eFL4Z_Rh2c6ci4Rev4kaXwtrV2WMUxiG6D16mTeH",
            clicked: false
        },
        {
            id: 6,
            image: "data:image/jpeg;base64,",
            clicked: false
        },
        {
            id: 7,
            image: "data:image/jpeg;base64,",
            clicked: false
        },
        {
            id: 8,
            image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRcfm9hDx26SLa8HgeAfPvPHZHC27IGzjLSLKZQtA8ZBsxq7PFy",
            clicked: false
        },
        {
            id: 9,
            image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR40mDe73ixHV6KivW2n2kEAp7zs7Beh9-PC6HceNw44Y3PKosl",
            clicked: false
        },
        {
            id: 10,
            image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTa5zPgsPhDmyqo7ugPayIx008LuRjVMkLRgL7Mw7MjN3KYI4nIyg",
            clicked: false
        }
    ],
    counter: 0,
    topScore: 0
};

sortImages = id => {
    const imageOrder = this.state.image;
    imageOrder.forEach((image, index) => {
        if (index === id) {
            if (imageOrder[index].clicked === true) {
               return this.setState({image: imageOrder.sort(() => Math.random() - 0.5), topScore: this.state.counter, counter: 0})
            }
            else {
                imageOrder[index].clicked = true;
               return this.setState({image: imageOrder.sort(() => Math.random() - 0.5), counter: this.state.counter + 1})
            }
        }
    })

};

  render() {
    return (
      <div className="App">
        <div className="App-header">
          <img src={logo} className="App-logo-left" alt="logo" />
          <img src={logo} className="App-logo-right" alt="logo" />
          <h2>Clickity Click Clack... React!</h2>
        </div>
        <h4 className="App-intro">
        See how many Images you can click without clicking the same one twice!
        <br />
        SCORE = {this.state.counter}
        <br />
        TOP SCORE = {this.state.topScore}  
        </h4>
        <div>
        <Game>
          {this.state.image.map(image => (
            <Images
              key={image.id}
              sortImages={this.sortImages}
              id={image.id}
              src={image.image}
              clicked={image.clicked}
            />
          ))}
        </Game>
        </div>
      </div>
    );
  }
}

export default App;
